import React from 'react';
import { BrowserRouter, Routes, Route } from "react-router-dom";

function Router() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<div>Home</div>} />
                <Route path="/">
                    <div>Register</div>
                </Route>
                <Route path="/">
                    <div>Login</div>
                </Route>
            </Routes>
        </BrowserRouter>
    )
}

export default Router
